import React from "react";

function Option(props) {
  return (
    <div>
      <div className="Option">
        {" "}
        <input type="checkbox" id={props.label} />
        {props.label}
      </div>
      <div>
        {props.duration === 1 ? (
          <>
            <p>Day 1</p>
            <div id="summary">
              <button>df</button>
            </div>
          </>
        ) : props.duration === 2 ? (
          <>
            <p>Day 1</p>
            <div id="summary">
              <button>df</button>
            </div>
            <p>Day 2</p>
            <div id="summary">
              <button>df</button>
            </div>
          </>
        ) : (
          <>
            <p>Day 1</p>
            <p>Day 2</p>
            <p>Day 3</p>
          </>
        )}
      </div>
    </div>
  );
}

export default Option;
